import React from 'react';
export default class Footer extends React.Component{

    render(){
        return (

            <footer id="main-footer">
              <p>SKYBOX Â© 2020, All Rights Reserved</p>
              <a target="_blank" rel="noopener" href="https://www.facebook.com/"><img className="social" src="https://en.facebookbrand.com/wp-content/uploads/2019/04/f_logo_RGB-Hex-Blue_512.png" alt="facebook logo" /></a>
              <a target="_blank" rel="noopener" href="https://www.instagram.com/"><img className="social" src="https://instagram-brand.com/wp-content/themes/ig-branding/assets/images/ig-logo-email.png" alt="instagram logo" /></a>
              <a target="_blank" rel="noopener" href="https://twitter.com/?lang=en"><img className="social" src="https://cdn3.iconfinder.com/data/icons/free-social-icons/67/twitter_circle_color-512.png" alt="twitter logo" /></a>     
            </footer>
        );
    };
}
